import TodosList from './todosList';
import Form from './Form';

const Todo = () => {
  const todosList = [
    {
      id: 1,
      content: '店予約する',
    },
    {
      id: 2,
      content: '卵買う',
    },
    {
      id: 3,
      content: '郵便出す',
    },
  ];

  return (
    <div>
      <h2>Remainder</h2>
      <TodoList />
      <Form />
    </div>
  );
};

export default Todo;
